export const SET_GAMER_NAME = "SET_GAMER_NAME"
export const BEGIN= "BIGIN";
export const LEVEL_UP = "LEVEL_UP"
export const END = "END"
export const HEAL= "HEAL";
export const ATTACK= "ATTACK"
export const CHANGE_DISPLAY_ANIMATION = "CHANGE_DISPLAY_ANIMATION"

export const setGamerName = (value:string) => ({
    type: SET_GAMER_NAME,
    value
})
export const begin = () => ({
    type: BEGIN,
})
export const levelUp = () => ({
    type: LEVEL_UP
})
export const end= () => ({
    type: END,
})

export const heal = () => ({
    type: HEAL,
})
export const attack = (value:number, player:string) => ({
    type: ATTACK,
    value,
    player,
})

export const changeDiplayAnimation = () => ({
    type: CHANGE_DISPLAY_ANIMATION
})
